import React from 'react'
import { Card } from 'antd'
import { foodDishes, foodTable } from '../Components/Constant'

const { Meta } = Card

const Home = () => {
    return (
        <div className='container'>
            <div className='suggested'>Suggested for you</div>
            <div className='card-container'>
                {foodTable.map((item) => {
                    console.log(item)
                    const tempUrl = 'https://recipes.timesofindia.com/recipes/pizza/rs56933159.cms'
                    return (
                        <Card
                            hoverable
                            style={{
                                width: 'calc(25% - 25px)',
                                marginBottom: '20px',
                                marginRight: '25px',
                            }}
                            cover={<img alt='example' src={tempUrl} />}
                        >
                            <Meta title='Waffles' description='https://thebelgianwaffle.co' />
                        </Card>
                    )
                })}
            </div>
        </div>
    )
}

export default Home
